import React from 'react';
import { Route, Routes } from "react-router-dom";

import Home from "./Pages/Home";
import About from "./Pages/About";


function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/about" component={About} />
          <Route path="/" component={Home} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
